import React from "react";
import { Grid, TextField } from "@material-ui/core";

const PayForm = ({ formdata, setFormdata }) => {
  console.log(formdata);
  return (
    <Grid Container >
      <Grid>
        
      </Grid>
      <form>
        <TextField
          label="Name"
          name="name"
          variant="filled"
          type="currency"
          style={{ width: 100 }}
          value={formdata.name}
          onChange={setFormdata}
        />
        <TextField
          label="Bank AC No"
          name="bank_acno"
          variant="filled"
          type="currency"
          style={{ width: 100 }}
          value={formdata.bank_acno}
          onChange={(e) => setFormdata(e)}
        />
        <button>Submit</button>
      </form>
    </Grid>
  );
};

export default PayForm;
